(function() {
    'use strict';

    // 移除所有現有的 visibilitychange、focus 和 blur 事件偵聽器
    document.removeEventListener("visibilitychange", function(){}, true);
    window.removeEventListener("focus", function(){}, true);
    window.removeEventListener("blur", function(){}, true);

    // 攔截並屏蔽新的 visibilitychange、focus 和 blur 事件偵聽器
    const originalAddEventListener = EventTarget.prototype.addEventListener;
    EventTarget.prototype.addEventListener = function(type, listener, options) {
        if (type === "visibilitychange" || type === "focus" || type === "blur") {
            console.log(`攔截 ${type} 事件偵聽器`);
            return; // 不註冊事件
        }
        return originalAddEventListener.call(this, type, listener, options);
    };
})();
